import React from 'react';
import '../Skills/style.css';

function Skills() {
    const state=[
        {   id:1,
            class:"col-xs-1 col-sm-2 col-md-2 devicon-javascript-plain colored",
        },
        {   id:2,
            class:"col-xs-1 col-sm-2 col-md-2 devicon-jquery-plain colored",
        },
        {   id:3,
            class:"col-xs-1 col-sm-2 col-md-2 devicon-nodejs-plain colored",
        },
        {   id:4,
            class:"col-xs-1 col-sm-2 col-md-2 devicon-express-original colored",
        },
        {   id:5,
            class:"col-xs-1 col-sm-2 col-md-2 devicon-sequelize-plain colored",
        },
        {   id:6,
            class:"col-xs-1 col-sm-2 col-md-2 devicon-mysql-plain-wordmark colored",
        },
        {   id:7,
            class:"col-xs-1 col-sm-2 col-md-2 devicon-postgresql-plain colored",
        },
        {   id:8,
            class:"col-xs-1 col-sm-2 col-md-2 devicon-mongodb-plain-wordmark colored",
        },
        {   id:9,
            class:"col-xs-1 col-sm-2 col-md-2 devicon-heroku-original colored",
        },
        {   id:10,
            class:"col-xs-1 col-sm-2 col-md-2 devicon-react-original colored",
        },
        {   id:11,
            class:"col-xs-1 col-sm-2 col-md-2 devicon-html5-plain colored",
        },
        {   id:12,
            class:"col-xs-1 col-sm-2 col-md-2 devicon-css3-plain-wordmark colored",
        },
        {   id:13,
            class:"col-xs-1 col-sm-2 col-md-2 devicon-bootstrap-plain colored",
        },
        {   id:14,
            class:"col-xs-1 col-sm-2 col-md-2 devicon-git-plain colored",
        },
        {   id:15,
            class:"col-xs-1 col-sm-2 col-md-2 devicon-github-plain colored",
        },
        {   id:16,
            class:"col-xs-1 col-sm-2 col-md-2 devicon-gitlab-plain colored",
        },
        {   id:17,
            class:"col-xs-1 col-sm-2 col-md-2 devicon-visualstudio-plain colored",
        },
        {   id:18,
            class:"col-xs-1 col-sm-2 col-md-2 devicon-webpack-plain-wordmark colored",
        },
        {   id:19,
            class:"col-xs-1 col-sm-2 col-md-2 devicon-slack-plain-wordmark colored",
        }

    ]
   



    return (
       <div className="container">
           <div className="box rounded">
             <h1 > Skills </h1>
           </div>
            <div className="row">
                {state.map(element=>{
                    return(
                        <i className={element.class}key={element.id}></i>
                    )
                })}
                
            </div>
       </div>
        
               

    )
}


export default Skills;


